INSERT INTO public.genre_name (id_genre_name, genre_name, description) VALUES (1, 'Action', 'Action film is a film genre in which the protagonist or protagonists are thrust into a series of events that typically include violence, extended fighting, physical feats, rescues and frantic chases');
INSERT INTO public.genre_name (id_genre_name, genre_name, description) VALUES (2, 'Adventure', 'An adventure film is form of adventure fiction, and is a genre of film. Subgenres of adventure films include swashbuckler films, pirate films, and survival films.');
INSERT INTO public.genre_name (id_genre_name, genre_name, description) VALUES (3, 'Comedy', 'A comedy film is a category of film in which the main emphasis is on humor. These films are designed to make the audience laugh through amusement and most often work by exaggerating characteristics for humorous effect.');
INSERT INTO public.genre_name (id_genre_name, genre_name, description) VALUES (4, 'Drama', 'In film and television, drama is a category of narrative fiction (or semi-fiction) intended to be more serious than humorous in tone. Drama of this kind is usually qualified with additional terms that specify its particular super-genre.');
INSERT INTO public.genre_name (id_genre_name, genre_name, description) VALUES (5, 'Fantasy', 'Fantasy films are films that belong to the fantasy genre with fantastic themes, usually magic, supernatural events, mythology, folklore, or exotic fantasy worlds.');
INSERT INTO public.genre_name (id_genre_name, genre_name, description) VALUES (6, 'Horror', 'A horror film is one that seeks to elicit fear or disgust in its audience for entertainment purposes. Horror films additionally aim to evoke viewers nightmares, revulsions and terror of the unknown or the macabre.');
INSERT INTO public.genre_name (id_genre_name, genre_name, description) VALUES (7, 'Science fiction', 'Science fiction (or sci-fi) is a film genre that uses speculative, fictional science-based depictions of phenomena that are not fully accepted by mainstream science, such as extraterrestrial lifeforms, robots, interstellar travel or other technologies.');
INSERT INTO public.type (id_type, type_name, description) VALUES (1, 'Movie', 'A film, also called a movie is a work of visual art used to simulate experiences that communicate ideas, stories, perceptions, feelings or atmosphere through the use of moving images. These images are generally accompanied by sound.');
INSERT INTO public.type (id_type, type_name, description) VALUES (2, 'TV show', 'A television show – or simply TV show – is any content produced for viewing on a television set which can be broadcast via over-the-air, satellite, or cable, excluding breaking news, advertisements, or trailers that are typically placed between shows.');
INSERT INTO public.type (id_type, type_name, description) VALUES (3, 'Theatre', 'Theatre or theater is a collaborative form of performing art that uses live performers, usually actors or actresses, to present the experience of a real or imagined event before a live audience in a specific place, often a stage. ');
INSERT INTO public.type (id_type, type_name, description) VALUES (4, 'Media clip', 'A media clip is a short segment of electronic media, either an audio clip or a video clip.');
INSERT INTO public.type (id_type, type_name, description) VALUES (5, 'Ad', 'Advertising is a marketing communication that employs an openly sponsored, non-personal message to promote or sell a product, service or idea.');
