INSERT INTO public.role_name (id_role, role_name, description) VALUES (1, 'Director', 'A film director controls a films artistic and dramatic aspects and visualizes the screenplay (or script) while guiding the film crew and actors in the fulfilment of that vision.');
INSERT INTO public.role_name (id_role, role_name, description) VALUES (2, 'Writer', 'A screenplay writer (also called screenwriter for short), scriptwriter or scenarist, is a writer who practices the craft of screenwriting, writing screenplays on which mass media, such as films and television programs, are based.');
INSERT INTO public.role_name (id_role, role_name, description) VALUES (3, 'Actor', 'An actor or actress is a person who portrays a character in the traditional medium of the theatre or in modern media such as film, radio, and television.');
INSERT INTO public.role_name (id_role, role_name, description) VALUES (4, 'Composer', 'A film score is original music written specifically to accompany a film. Scores are written by one or more composers in collaboration with, the films director or producer and are then usually performed by musicians – most often comprising an orchestra.');
INSERT INTO public.role_name (id_role, role_name, description) VALUES (5, 'Camera operator', 'A camera operator, or depending on the context cameraman or camerawoman, is a professional operator of a film camera or video camera as part of a film crew.');
